import React from "react";
import "./Hero.css";

function Hero() {
  return (
    <section
      className="hero-section"
      style={{
        backgroundImage: "url('/assets/onxytree.png')", // ✅ public path
        backgroundSize: "cover",
        backgroundPosition: "center",
        backgroundRepeat: "no-repeat",
        backgroundColor: "#fff", // in case image has transparency
      }}
    >
      <div className="hero-overlay">
        <h2>YEAR OVER YEAR. KNOWLEDGE SHARED. LEGACIES BUILT.</h2>
        <h3>ONYX 81</h3>
        <div className="tagline">STRONGER TOGETHER</div>
        <p>ASSET LIBRARY PROMO VIDEO</p>
        <small>An extension of our community</small>
      </div>
    </section>
  );
}

export default Hero;
